VALUES ('2000000070405', 'Vitaline Tomates, manioc, ail, origan', 'Mélange d\'huiles* en poudre (tournesol oléique*, colza*, lin* ; support : sirop de manioc non raffiné*, fibres d\'acacia* ; antioxydant : extrait naturel de romarin*), protéines de graines de tournesol*, sirop de manioc non raffiné*, tomates* 12,5%, farine de sarrasin*, protéines de pois*,  farine de châtaigne*,  lin jaune*, pommes de terre*, citron*, paprika doux*, lait de coco*, maca*, sel de Guérande, ail*, origan*, lithothamne, baies d\'açaï*, acérola*, moringa*, carottes*, roucou*, son de riz*, feuilles de curry*, basilic*, citrons*, épinards*, persil*, amla*, thé vert*, shitake*, lichens*, spiruline*, antioxydant : extrait naturel de romarin*.  Mix de minéraux : chlorure de sodium, chlorure de chrome, chlorure de potassium, citrate trimagnésium, molybdate de sodium, iodure de potassium, pyrophosphate de fer, gluconate de zinc, citrate de calcium, L-sélénométhionine', 'https://static.openfoodfacts.org/images/products/200/000/007/0405/front_fr.18.400.jpg', '3.6', '0.5', '10.1', '1.7', '2.4', '4.4', '0.22', '0.0866141732283465', '0', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('2000000070411', 'Vitaline Carottes, sarrasin, curcuma, lait de coco', 'Mélange d\'huiles* en poudre (tournesol oléique*, colza*, lin* ; support : sirop de manioc non raffiné*, fibres d\'acacia* ; antioxydant : extrait naturel de romarin*), farine de sarrasin*, sirop de manioc non raffiné*, protéines de lait* (origine : Suisse), carottes* 5,7%, lin jaune*, farine de châtaigne*, protéines de pois*, jus de carottes* 3,8%, oignons*, pommes de terre *, curry* 1,5%, lait de coco*, maca*, sel de Guérange, curcuma* 0,8%, baies d\'açaï*, lithothamne, acérola*, moringa*, roucou*, son de riz*, feuilles de curry*, basilic*, citrons*, épinards*, persil*, amla*, thé vert*, shitake*, lichens*, spiruline*, antioxydant : extrait naturel de romarin*. Mix de vitamines : A, B2, B3, B5, B6, B8, B9, C (acérola), D3, K2. Mix de minéraux : chlorure de sodium, chlorure de potassium, citrate de fer, gluconate de zinc, iodure de potassium, molybdate de sodium, sélénite de sodium, chlorure de chrome.', 'https://static.openfoodfacts.org/images/products/200/000/007/0411/front_fr.26.400.jpg', '14', '2.2', '51.8', '8.3', '6.3', '17.6', '0.94', '0.37007874015748', '', '1');

