VALUES ('2000000070415', 'Vitaline Recover Butternut', 'Protéines de lait bio (origine : Suisse), butternut (14,1 g), extrait de manioc bio, farine de sarrasin bio, farine de châtaigne bio, lin jaune bio, huile de tournesol oléique, protéines de pois bio, oignon bio (4,5 g), agave bio, malate de citrulline (2 g), lait de coco bio, maca bio, BCAA (L-Leucine (500 mg), L-Isoleucine (250 mg), L-Valine (250 mg)), créatine (1 g), curcuma bio, baies d\'açaï bio, extraits et concentrés de fruits et légumes (extraits végétaux titrés en polyphénols : thé vert 69 mg, pépins et marc de raisin 30 mg ; concentrés de fruits et légumes 105 mg : myrtille, carotte, pamplemousse, papaye, ananas, fraise, pomme, abricot, cerise, orange, tomate, cassis, brocoli, chou vert, oignon, ail, asperge, concombre), lactose, spiruline bio, chlorella bio, antioxydant : extrait naturel de romarin bio, poivre noir bio, probiotiques. Mix de vitamines : A, B2, B3, B5, B6, B8, B9, C (acérola), D3, K2. Mix de minéraux : chlorure de sodium, chlorure de potassium, citrate de fer, gluconate de zinc, iodure de potassium, molybdate de sodium, sélénite de sodium, chlorure de chrome.', 'https://static.openfoodfacts.org/images/products/200/000/007/0415/front_fr.16.400.jpg', '2.1', '0.4', '10.9', '2.3', '1.2', '5.6', '0.21', '0.0826771653543307', '', '1');

