VALUES ('2000000165707', '4 Donuts Assortis + 2 Gratuits', 'Donuts sucré : farine de _blé_, eau, graisse végétale (palme), sucre, dextrose, huile végétale (navette), levure, farine de _soja_, _lactosérum_, poudres à lever : E450, E500, sel émulsifiants : E471, E481, arôme (vanilline), _lait_ écrémé en poudre, antioxydant : E300, _œuf_ entier en poudre et colorant : E160a. Donuts fourrés au chocolat : Pâte : farine de _blé_, eau, graisse végétale (palme), dextrose, huile végétale (navette), levure, farine de _soja_, _lactosérum_, poudres à lever : E450, E500, sel émulsifiants : E471, E481, extrait de vanille, _lait_ écrémé en poudre, antioxydant : E300, _œuf_ entier en poudre et colorant : E160a. Garniture 26,7 % : sucre, huile végétale (tournesol), graisse végétale (palme et palmiste en proportions variables), cacao dégraissé en poudre, _lactosérum_ en poudre, pâte de _noisettes_, émulsifiants : E322 (_soja_) et arômes naturels. Donuts chocolat noir rayé chocolat blanc : Pâte : farine de _blé_, eau, graisse végétale (palme), dextrose, huile végétale (navette), levure, farine de _soja_, _lactosérum_, poudres à lever : E450, E500, sel émulsifiants : E471, E481, arôme, _lait_ écrémé en poudre, antioxydant : E300, _œuf_ entier en poudre et colorant : E160a. Nappage 30,2 % : sucre, graisse végétale (coco et palmiste en proportions variables), cacao dégraissé en poudre, _lait_ entier en poudre, _lactosérum_ en poudre, _lactose_, amidon de maïs, émulsifiants : E322 (_soja_), E476, et arômes naturels. Donuts chocolat blanc rayé chocolat noir : Pâte : farine de _blé_, eau, graisse végétale (palme), dextrose, huile végétale (navette), levure, farine de _soja_, _lactosérum_, poudres à lever : E450, E500, sel émulsifiants : E471, E481, arôme, _lait_ écrémé en poudre, antioxydant : E300, _œuf_ entier en poudre et colorant : E160a. Nappage 45,0 % : sucre, graisse végétale (coco et palmiste en proportions variables),  _lactosérum_ en poudre, _lactose_, amidon de maïs, cacao dégraissé en poudre, _lait_ entier en poudre, émulsifiants : E322 (_soja_), E476, et arômes naturels.', 'https://static.openfoodfacts.org/images/products/200/000/016/5707/front_fr.5.400.jpg', '', '', '', '', '', '', '', '', '', '0');

